import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Button, Text, View } from 'react-native';

export default class App extends React.Component {

	constructor(props){
		super(props);

		this.buttons = {
			answer1: "8 bits",
			answer2: "16 bits",
			answer3: "32 bits",
			answer4: "12 bits",
		};

		this.styles = StyleSheet.create({
		  container: {
			flex: 1,
			backgroundColor: '#fff',
			alignItems: 'center',
			justifyContent: 'center',
		  },

		  answers: {
			display: 'grid',
			gridTemplateRows: 'repeat(2, 1fr)',
			gridTemplateColumns: 'repeat(2, 1fr)',
			gap: '50px',

			padding: '30px',
		  },

		  question: {
			  fontSize: 32,
			  fontWeight: 'bold',
		  },

		  buttons: {
			width: 500,  
		  },
		});

		this.bytes = 4;
	}

	componentDidMount() {
		console.log("Component did mount");
	}

	render () {
		return (
			<View style={this.styles.container}>
			  <Text style={this.styles.question}>How much bits are in {this.bytes} bytes?</Text>
			  <View style={this.styles.answers}>
				<Button id={this.buttons.answer1} title={(this.bytes * 2) + " bits"} />
				<Button id={this.buttons.answer1} title={(this.bytes * 4) + " bits"} />
				<Button id={this.buttons.answer1} title={(this.bytes * 8) + " bits"} />
				<Button id={this.buttons.answer1} title={(this.bytes * 3) + " bits"} />
				<Button style={this.styles.buttons} title="Next" />
			  </View>
			  <StatusBar style="auto" />
			</View>
		  );
	}
}
